import base64
import numpy as np
import time


def decode(base64_string):
    header, data = base64_string.split(';base64,')
    ext = header.split('/')[-1]
    with open("../database/old.png", 'wb') as f:
        f.write(base64.b64decode(data))

    return "../database/old.png"


def encode(path):
    base64_image = base64.encode(path)
    return base64_image

